import logo from './logo.svg';
import './App.css';

function App() {

  let welcome=(name)=>{
    return <h1>Hello {name}</h1>
  }

  const name = 'test name'
  const element = <h1>Hello {name}</h1>
  const img = <image src="/public/logo192.png" alt="logo"> logo</image>
  return img;
}

export default App;
